// Get the integer floor.
int flo(double d){
    return fint(floor(d));
}

// Get the integer ceil.
int cei(double d){
    return fint(ceil(d));
}


// Model constants.
clock time;
const int maxVelocityEgo = 20;
const int maxVelocityFront = 20;
const int minVelocityEgo = -10;
const int minVelocityFront = -10;

const int maxSensorDistance = 200;


clock waitTimer;
broadcast chan update;

// Global distance variables.
int distance_gua[2] = {20,20}; // minimum lower and maximum upper bound during next interfall
int distance_gua_evol[2] = {20,20}; // lower and upper bound at end next interfall

// Global Ego variables.
int velocityEgo_gua[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityEgo_gua_evol[2];// = {0,0}; // lower and upper bound at end next interfall
int[-2,2] accelerationEgo;
broadcast chan chooseEgo;

// Global Front variables.
int velocityFront_gua[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityFront_gua_evol[2];// = {0,0}; // lower and upper bound at end next interfall
int[-2,2] accelerationFront;
broadcast chan chooseFront;


// Lipschitz and Lipschitz-based constants.
const int number_modes = 9;

const double OSL[number_modes] = {0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547};
const double LIP[number_modes] = {1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308};
// Modes
//   2   2   2   0   0   0  -2  -2  -2
//   2   0  -2   2   0  -2   2   0  -2
//   0   0   0   0   0   0   0   0   0
const double MAXF1 = 30.133038346638727;
const double MAXF2 = 30.066592756745816;
const double MAXF3 = 30.133038346638727;
const double MAXF4 = 30.066592756745816;
const double MAXF5 = 30.0;
const double MAXF6 = 30.066592756745816;
const double MAXF7 = 30.133038346638727;
const double MAXF8 = 30.066592756745816;
const double MAXF9 = 30.133038346638727;

const double C0F[number_modes] = {MAXF1*LIP[0],MAXF2*LIP[1],MAXF3*LIP[2],MAXF4*LIP[3],MAXF5*LIP[4],MAXF6*LIP[5],MAXF7*LIP[6],MAXF8*LIP[7],MAXF9*LIP[8]};


// Euler interpretation constants.
const double period_size = 1.0;
const int euler_sub_step = 5;
const double tau = period_size/euler_sub_step;


// Get the current control mode based on the accelerations of Front and Ego.
int find_mode(int accFront, int accEgo){
    int mode_det;
    if(accFront == 2 && accEgo == 2){mode_det = 0;}
    if(accFront == 2 && accEgo == 0){mode_det = 1;}
    if(accFront == 2 && accEgo == -2){mode_det = 2;}
    if(accFront == 0 && accEgo == 2){mode_det = 3;}
    if(accFront == 0 && accEgo == 0){mode_det = 4;}
    if(accFront == 0 && accEgo == -2){mode_det = 5;}
    if(accFront == -2 && accEgo == 2){mode_det = 6;}
    if(accFront == -2 && accEgo == 0){mode_det = 7;}
    if(accFront == -2 && accEgo == -2){mode_det = 8;}
    return mode_det;
}

// The linear approximation error evolution function (Definition 3).
double delta_mode(double delta, int mode){
    if (OSL[mode] > 0) {
        return sqrt(delta*delta*exp(3*OSL[mode]*tau) + C0F[mode]*C0F[mode]/(3*OSL[mode]*OSL[mode])*(-tau*tau - 2*tau/(3*OSL[mode]) + 2/(9*OSL[mode]*OSL[mode])*(exp(3*OSL[mode]*tau)-1)));       
    }
    if (OSL[mode] == 0) {
        return sqrt(delta*delta*exp(tau) + C0F[mode]*C0F[mode]*(-tau*tau -2*tau + 2*(exp(tau)-1)));
    }
    if (OSL[mode] < 0) {
        return sqrt(delta*delta*exp(OSL[mode]*tau) + (C0F[mode]*C0F[mode]/(OSL[mode]*OSL[mode]))*(tau*tau+2*tau/OSL[mode]+2/(OSL[mode]*OSL[mode])-2*exp(OSL[mode]*tau)/(OSL[mode]*OSL[mode])));
    }
    return(0);
}

// Get the minimal value.
double mini(double d1, double d2){
    if(d1 < d2){return d1;}
    else{return d2;}
}

// Get the maximum value.
double maxi(double d1, double d2){
    if(d1 < d2){return d2;}
    else{return d1;}
}


// Perform euler approximations for a single period.
void eulerDiscrete(){
    double dist, velEgo, velFront, rho;
    double memdist_min, memdist_max, memVF_min, memVF_max, memVE_min, memVE_max;

    int i;

    // Initialize values. 
    dist = (distance_gua_evol[0]+distance_gua_evol[1])/2.0;
    velFront = (velocityFront_gua_evol[0]+velocityFront_gua_evol[1])/2.0;
    velEgo = (velocityEgo_gua_evol[0]+velocityEgo_gua_evol[1])/2.0;
    rho = sqrt((distance_gua_evol[1]-distance_gua_evol[0])*(distance_gua_evol[1]-distance_gua_evol[0])/4.0 
                + (velocityFront_gua_evol[1]-velocityFront_gua_evol[0])*(velocityFront_gua_evol[1]-velocityFront_gua_evol[0])/4.0 
                + (velocityEgo_gua_evol[1]-velocityEgo_gua_evol[0])*(velocityEgo_gua_evol[1]-velocityEgo_gua_evol[0])/4.0);

    memdist_min = dist - rho;
    memdist_max = dist + rho;
    memVF_min = velFront - rho;
    memVF_max = velFront + rho;
    memVE_min = velEgo - rho;
    memVE_max = velEgo + rho;

    // Perform the sub steps (Equations 17 and 19)
    for (i=0;i<=euler_sub_step - 1;i++){
        dist = dist + tau*(velFront - velEgo);
        velEgo = velEgo + tau*accelerationEgo;
        velFront = velFront + tau*accelerationFront;
        rho = delta_mode(rho,find_mode(accelerationFront,accelerationEgo));

        memdist_min = mini(memdist_min,dist - rho);
        memdist_max = maxi(memdist_max,dist + rho);
        memVF_min = mini(memVF_min,velFront - rho);
        memVF_max = maxi(memVF_max,velFront + rho);
        memVE_min = mini(memVE_min,velEgo - rho);
        memVE_max = maxi(memVE_max,velEgo + rho);   
    }

    // Convert final values to integers.
    distance_gua[0] = flo(memdist_min);
    distance_gua[1] = cei(memdist_max);
    velocityFront_gua[0] = flo(memVF_min);
    velocityFront_gua[1] = cei(memVF_max);
    velocityEgo_gua[0] = flo(memVE_min);
    velocityEgo_gua[1] = cei(memVE_max);
}


// Calculate the discrete time solution after a single period (Equation 5).
void updateDiscrete(){
    velocityEgo_gua_evol[0] = velocityEgo_gua_evol[0] + accelerationEgo;
    velocityEgo_gua_evol[1] = velocityEgo_gua_evol[1] + accelerationEgo;
    velocityFront_gua_evol[0] = velocityFront_gua_evol[0] + accelerationFront;
    velocityFront_gua_evol[1] = velocityFront_gua_evol[1] + accelerationFront;

    if (distance_gua_evol[0] > maxSensorDistance) {
        distance_gua_evol[0] = maxSensorDistance + 1;
        distance_gua_evol[1] = maxSensorDistance + 1;
    } else {
        distance_gua_evol[0] = flo(distance_gua_evol[0] + (velocityFront_gua_evol[0]-accelerationFront) - (velocityEgo_gua_evol[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2.0);// - (oldVel + newVel)/2;
        distance_gua_evol[1] = cei(distance_gua_evol[1] + (velocityFront_gua_evol[0]-accelerationFront) - (velocityEgo_gua_evol[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2.0);//(oldVel + newVel)/2;

        if (distance_gua_evol[1] > maxSensorDistance) {
        distance_gua_evol[1] = maxSensorDistance + 1;
        }
    }
}


// Hybrid stuff
hybrid clock rVelocityEgo;
hybrid clock rVelocityFront;
hybrid clock rDistance;
hybrid clock D;

template.declaration:
double distanceRate(double velFront, double velEgo, double dist){
    if (dist > maxSensorDistance)
        return 0.0;
    else 
        return velFront - velEgo;
}
